import * as React from "react";
import {
  Box,
  Heading,
  VStack,
  FormControl,
  Input,
  Link,
  Button,
  Center,
  NativeBaseProvider,
} from "native-base";
import { Image } from "react-native";
export default function ({ navigation }) {
  return (
    <NativeBaseProvider>
        <Image
        source={{
          uri: "https://kalbelearningcentre.kalbe.co.id/Portals/0/EasyDNNnews/52/img-IP.png",
        }}
        style={{ width: "100%", height: "250px", position: "absolute", marginTop: 60 }}
      />
      <View style={{ margin: 10 }}>
        <Image
          source={{
            uri: "https://online.ider.edu.mn/pluginfile.php/1/theme_moove/logo/1642383289/Final%20logo%2002-1green-web.png",
          }}
          style={{ height: 60, position: "relative" }}
        />
      </View>
      <Center w="100%">
        <Box safeArea p="2" py="8" w="90%" maxW="290">
          <Heading
            size="lg"
            fontWeight="600"
            color="coolGray.800"
            _dark={{
              color: "warmGray.50",
            }}
          >
           IU-22
          </Heading>
          <Heading
            mt="1"
            _dark={{
              color: "warmGray.200",
            }}
            color="coolGray.600"
            fontWeight="medium"
            size="xs"
          >
            Тавтай Морилно уу! 
          </Heading>

          <VStack space={3} mt="5">
            <FormControl>
              <FormControl.Label></FormControl.Label>
              <Input placeholder="Нэвтрэх нэр"/>
            </FormControl>
            <FormControl>
              <FormControl.Label></FormControl.Label>
              <Input type="password" placeholder="Нууц үг" />
              <Link
                _text={{
                  fontSize: "xs",
                  fontWeight: "500",
                  color: "indigo.500",
                }}
                alignSelf="flex-end"
                mt="1"
              >
                Нууц үгээ мартсан уу?
              </Link>
            </FormControl>
            <Button style={{backgroundColor:"blue"}} onPress={() => navigation.navigate("Home")}>Нэвтрэх</Button>
          </VStack>
        </Box>
      </Center>
    </NativeBaseProvider>
  );
}
